var some = 200;

function Layout() {
  return (
    <>
      <style>
        {
          "\
      .BorAnim{\
        width: \px;\
        height: 200px;\
        background-color: red;\
    }\
      "
        }
      </style>
      <div className="BorAnim"></div>
    </>
  );
}

export default Layout;
